# Game of Thrones
# https://www.hackerrank.com/challenges/game-of-thrones/problem
def gameOfThrones(s):
    charCounts = {}
    for i in s:
        if i in charCounts.keys():
            charCounts[i] += 1
        else:
            charCounts[i] = 1

    if len(s) % 2 == 0:
        # Is the count of each character evenly divisible by 2?
        return 'YES' if (set([(int(i) % 2 == 0) for i in set(charCounts.values())]) == {True}) else 'NO'

    evenOdd = {
        'Even' : 0,
        'Odd' : 0
    }
    for i in charCounts.values():
        if evenOdd['Odd'] > 1:
            return 'NO'

        if i %2 != 0:
            evenOdd['Odd'] += 1

    return 'YES'
